style.css:
@-moz-document domain("mail.google.com") {
/* .la-c is for the new 2020 gmail design */

#loading > div > .la-e > * {
  display: none;
}

#loading > div > .la-e {
    height: 168px !important;
    width:  272px !important;
    background: transparent url("https://cdn.discordapp.com/attachments/1158722937449361501/1158723758392082492/LOAD.png?ex=651d4918&is=651bf798&hm=eb8d6fb3b819c9f304c8e72f33bb6e7695618b9d37968e3759758baf7594a244&") center no-repeat !important;
    
    animation-name: spin;
    animation-duration: 8000ms;
    animation-iteration-count: infinite;
    animation-timing-function: linear; 
}
}

@-moz-document domain("mail.google.com") {
