    background: #036 url("https://cdn.discordapp.com/attachments/1158722937449361501/1158723758392082492/LOAD.png?ex=651d4918&is=651bf798&hm=eb8d6fb3b819c9f304c8e72f33bb6e7695618b9d37968e3759758baf7594a244&") !important;
    height: 21px !important;
    
}

#nlpt::before {
